INSERT INTO `bloggs` (`Bloger_id`, `bloge_title`, `bloge_content`, `bloge_date`, `image_bloge`, `user_id`) VALUES
(1, 'ALGORITHMS', 'Before there were computers, there were algorithms. But now that there are computers,\r\nthere are even more algorithms, and algorithms lie at the heart of computing.\r\nThis book provides a comprehensive introduction to the modern study of computer\r\nalgorithms. It presents many algorithms and covers them in considerable\r\ndepth, yet makes their design and analysis accessible to all levels of readers. We\r\nhave tried to keep explanations elementary without sacrificing depth of coverage\r\nor mathematical rigor.\r\nEach chapter presents an algorithm, a design technique, an application area, or a\r\nrelated topic. Algorithms are described in English and in a pseudocode designed to\r\nbe readable by anyone who has done a little programming. The book contains 244\r\nfigures—many with multiple parts—illustrating how the algorithms work. Since\r\nwe emphasize efficiency as a design criterion, we include careful analyses of the\r\nrunning times of all our algorithms.\r\nThe text is intended primarily for use in undergraduate or graduate courses in\r\nalgorithms or data structures. Because it discusses engineering issues in algorithm\r\ndesign, as well as mathematical aspects, it is equally well suited for self-study by\r\ntechnical professionals.\r\nIn this, the third edition, we have once again updated the entire book. The\r\nchanges cover a broad spectrum, including new chapters, revised pseudocode, and\r\na more active writing style.\r\nWe have designed this book to be both versatile and complete. You should find it\r\nuseful for a variety of courses, from an undergraduate course in data structures up\r\nthrough a graduate course in algorithms. Because we have provided considerably\r\nmore material than can fit in a typical one-term course, you can consider this book\r\nto be a “buffet” or “smorgasbord” from which you can pick and choose the material\r\nthat best supports the course you wish to teach.\r\nYou should find it easy to organize your course around just the chapters you\r\nneed. We have made chapters relatively self-contained, so that you need not worry\r\nabout an unexpected and unnecessary dependence of one chapter on another. Each\r\nchapter presents the easier material first and the more difficult material later, with\r\nsection boundaries marking natural stopping points. In an undergraduate course,\r\nyou might use only the earlier sections from a chapter; in a graduate course, you\r\nmight cover the entire chapter.\r\nWe have included 957 exercises and 158 problems. Each section ends with exercises,\r\nand each chapter ends with problems. The exercises are generally short questions\r\nthat test basic mastery of the material. Some are simple self-check thought\r\nexercises, whereas others are more substantial and are suitable as assigned homework.\r\nThe problems are more elaborate case studies that often introduce new material;\r\nthey often consist of several questions that lead the student through the steps\r\nrequired to arrive at a solution.\r\nDeparting from our practice in previous editions of this book, we have made\r\npublicly available solutions to some, but by no means all, of the problems and exercises.\r\nOur Web site, http://mitpress.mit.edu/algorithms/, links to these solutions.\r\nYou will want to check this site to make sure that it does not contain the solution to\r\nan exercise or problem that you plan to assign. We expect the set of solutions that\r\nwe post to grow slowly over time, so you will need to check it each time you teach\r\nthe course.\r\nWe have starred (?) the sections and exercises that are more suitable for graduate\r\nstudents than for undergraduates. A starred section is not necessarily more difficult\r\nthan an unstarred one, but it may require an understanding of more advanced\r\nmathematics. Likewise, starred exercises may require an advanced background or\r\nmore than average creativity.', '2019-10-05 19:10:38', , 56);
INSERT INTO `bloggs` (`Bloger_id`, `bloge_title`, `bloge_content`, `bloge_date`, `image_bloge`, `user_id`) VALUES
(2, 'Programmable Logic Controllers', 'Technological advances in recent years have resulted in the development\r\nof the programmable logic controller and a consequential revolution of\r\ncontrol engineering. This book is an introduction to programmable logic\r\ncontrollers and aims to ease the tasks of practising engineers coming first\r\ninto contact with programmable logic controllers, and also provides a\r\nbasic course for students on courses such as Nationals and Higher\r\nNationals in Engineering, company training programmes and as an\r\nintroduction for first year undergraduate courses in engineering.\r\nThe book has been designed to provide full syllabus coverage of the\r\nBTEC National and Higher National in Engineering units Programmable\r\nControllers and Programmable Logic Controllers from Edexcel. It\r\naddresses the problem of different programmable control manufacturers\r\nusing different nomenclature and program forms by describing the\r\nprinciples involved and illustrating them with examples from a range of\r\nmanufacturers. The text includes:\r\n- The basic architecture of PLCs and the characteristics of commonly\r\nused input and outputs to such systems.\r\n- A discussion of the number systems: denary, binary, octal,\r\nhexadecimal and BCD.\r\n- A painstaking methodical introduction, with lots of illustrations, of\r\nhow to program PLCs, whatever the manufacturer, and make use of\r\ninternal relays, timers, counters, shift registers, sequencers and data\r\nhandling facilities.\r\n- Consideration of the standards given by IEC 1131-3 and the\r\nprogramming methods of ladder, functional block diagram,\r\ninstruction list, structured text and sequential function chart.\r\n- To assist the reader to develop the skills necessary to write programs\r\nfor programmable logic controllers, many worked examples,\r\nmulti-choice questions and problems are included in the book with\r\nanswers to all multi-choice questions and problems given at the end\r\nof the book.\r\nChanges from third edition\r\nThe fourth edition is a complete restructuring and updating of the third\r\nedition and includes a more detailed consideration of IEC 1131-3,\r\nincluding all the programming methods given in the standard, and the\r\nproblems of safety. This includes a discussion of emergency stop relays\r\nand safety PLCs.\r\nAims\r\nThis book aims to enable the reader to:\r\n- Identify and explain the main design characteristics, internal\r\narchitecture and operating principles of programmable logic\r\ncontrollers.\r\n- Describe and identify the characteristics of commonly used input and\r\noutput devices.\r\n- Explain the processing of inputs and outputs by PLCs.\r\n- Describe communication links involved with PLC systems, the\r\nprotocols and networking methods.\r\n- Develop ladder programs for the logic functions AND, OR, NOR,\r\nNAND, NOT and XOR.\r\n- Develop ladder programs involving internal relays, timers, counters,\r\nshift registers, sequencers and data handling.\r\n- Develop functional block diagram, instruction list, structured text and\r\nsequential function chart programs.\r\n-Identify safety issues with PLC systems.\r\n-Identify methods used for fault diagnosis, testing and debugging.\r\nStructure of the book\r\nThe figure on the following page outlines the structure of the book.', '2019-10-07 04:45:36', , 57),
(4, 'PHP & MySQL', 'It was 1998, I was twelve, and my parents had just bought the family our first\r\nmodern PC. It wasn’t long before I had figured out how to change the code for one\r\nof my favorite first-person shooter games—little things like making the rocket\r\nlauncher fire a hundred rockets a second instead of one, then having it fire a\r\nhundred rockets in every direction … and promptly crashing the game. I was\r\nhooked, and I’ve been programming ever since.\r\nThe game was multiplayer. Other people had also discovered how to change the\r\ncode, and the arms race quickly escalated. Someone would fire a hundred rockets\r\nat me. I’d have a script ready that would instantly build a wall right in front of me\r\nto block them all.\r\nMy opponent would spawn a dozen land mines underneath me. I’d turn off the\r\ngravity, then jump, soaring away from the impending explosion. Everyone could\r\nfly. It got to the point where it was no longer fun. You’d enter a game and\r\nsomeone had written a script to teleport you to the other side of the map, kill you\r\ninstantly and force you to respawn, repeating the process a dozen times a second.\r\nThey’d freeze your controls too, of course.\r\nWe discovered ways to block all this, but by the end it was a stalemate. Whoever\r\nmanaged to enter the game first could take complete control of it, and no matter\r\nhow good your scripts were, there was nothing you could do. It was fun while it\r\nlasted.\r\nThat’s how I learned the basics of coding, and that the only limit is your own\r\nimagination and creativity. During that time, I’d also taught myself HTML, and\r\nhad my own website where I shared some of my game hacking techniques and\r\nscripts. No, the website is not still up. Yes, it was terrible, full of bad grammar\r\nand cheesy animations (which was the style at the time, I promise!).\r\nBy 2000, I had taught myself the basics of PHP/MySQL and was running a\r\nwebsite for a group of fellow gamers. I wrote some crude PHP scripts for posting\r\nnews on the website, as well as polls, and even a script for handling our minitournament\r\nrankings and fixtures.\r\nPreface xv\r\nAfter that, I moved onto writing desktop applications in a horrible language\r\ncalled Delphi, writing tools that aided people in modding various games. I\r\ngraduated from University in 2007 with a degree in Software Engineering, worked\r\nfor various companies as a PHP developer, and these days I’m back at the\r\nUniversity studying for a PhD and working as a lecturer, spreading my passion for\r\nprogramming.\r\nI’m 31 now, and I’ve been programming for more of my life than not. It’s fun, it’s\r\nsomething I thoroughly enjoy doing. I’m writing this book to share my knowledge\r\nwith you and help you steer clear of some traps that are easy to fall into.\r\nLearning to code is very enjoyable and rewarding. You can watch your program\r\ncome alive as you build it. However, it can also be an incredibly frustrating\r\nexperience. In this book, I’m going to try to use my own experience to give you a\r\nsmoother ride than I and a lot of developers have had. I can steer you in the right\r\ndirection from the start.\r\nBefore I introduce you to any code, I’m going to give you some general advice\r\nabout programming and learning to code which I give to all my students.\r\nThis book is aimed at intermediate and advanced web designers looking to make\r\nthe leap into server-side programming. You’ll be expected to be comfortable with\r\nsimple HTML, as I’ll make use of it without much in the way of explanation. No\r\nknowledge of Cascading Style Sheets (CSS) or JavaScript is assumed or required,\r\nbut if you do know JavaScript, you’ll find it will make learning PHP a breeze,\r\nsince these languages are quite similar.\r\nBy the end of this book, you can expect to have a grasp of what’s involved in\r\nbuilding a modern PHP website, the basics of PHP, and tried and tested\r\ntechniques that are used by developers today.', '2019-10-07 05:17:39', , 64);
INSERT INTO `bloggs` (`Bloger_id`, `bloge_title`, `bloge_content`, `bloge_date`, `image_bloge`, `user_id`) VALUES
(5, 'Data Structures and Algorithms in Java', 'Data Structures and Algorithms in Java provides an introduction to data structures\r\nand algorithms, including their design, analysis, and implementation. The major\r\nchanges in this sixth edition include the following:\r\n• We redesigned the entire code base to increase clarity of presentation and\r\nconsistency in style and convention, including reliance on type inference, as\r\nintroduced in Java 7, to reduce clutter when instantiating generic types.\r\n• We added 38 new figures, and redesigned 144 existing figures.\r\n• We revised and expanded exercises, bringing the grand total to 794 exercises!\r\nWe continue our approach of dividing them into reinforcement, creativity,\r\nand project exercises. However, we have chosen not to reset the numbering\r\nscheme with each new category, thereby avoiding possible ambiguity\r\nbetween exercises such as R-7.5, C-7.5, P-7.5.\r\n• The introductory chapters contain additional examples of classes and inheritance,\r\nincreased discussion of Java’s generics framework, and expanded coverage\r\nof cloning and equivalence testing in the context of data structures.\r\n• A new chapter, dedicated to the topic of recursion, provides comprehensive\r\ncoverage of material that was previously divided within Chapters 3, 4, and\r\n9 of the fifth edition, while newly introducing the use of recursion when\r\nprocessing file systems.\r\n• We provide a new empirical study of the efficiency of Java’s StringBuilder\r\nclass relative to the repeated concatenation of strings, and then discuss the\r\ntheoretical underpinnings of its amortized performance.\r\n• We provide increased discussion of iterators, contrasting between so-called\r\nlazy iterators and snapshot iterators, with examples of both styles of implementation\r\nfor several data structures.\r\n• We have increased the use of abstract base classes to reduce redundancy\r\nwhen providing multiple implementations of a common interface, and the\r\nuse of nested classes to provide greater encapsulation for our data structures.\r\n• We have included complete Java implementations for many data structures\r\nand algorithms that were only described with pseudocode in earlier editions.\r\nThese new implementations include both array-based and linked-list-based\r\nqueue implementations, a heap-based adaptable priority queue, a bottom-up\r\nheap construction, hash tables with either separate chaining or linear probing,\r\nsplay trees, dynamic programming for the least-common subsequence problem,\r\na union-find data structure with path compression, breadth-first search\r\nof a graph, the Floyd-Warshall algorithm for computing a graph’s transitive\r\nclosure, topological sorting of a DAG, and both the Prim-Jarn´ık and Kruskal\r\nalgorithms for computing a minimum spanning tree.\r\nWe assume that the reader is at least vaguely familiar with a high-level programming\r\nlanguage, such as C, C++, Python, or Java, and that he or she understands the\r\nmain constructs from such a high-level language, including:\r\n• Variables and expressions\r\n• Methods (also known as functions or procedures)\r\n• Decision structures (such as if-statements and switch-statements)\r\n• Iteration structures (for-loops and while-loops)\r\nFor readers who are familiar with these concepts, but not with how they are expressed\r\nin Java, we provide a primer on the Java language in Chapter 1. Still, this\r\nbook is primarily a data structures book, not a Java book; hence, it does not provide\r\na comprehensive treatment of Java. Nevertheless, we do not assume that the reader\r\nis necessarily familiar with object-oriented design or with linked structures, such\r\nas linked lists, for these topics are covered in the core chapters of this book.\r\nIn terms of mathematical background, we assume the reader is somewhat familiar\r\nwith topics from high-school mathematics. Even so, in Chapter 4, we discuss\r\nthe seven most-important functions for algorithm analysis. In fact, sections that use\r\nsomething other than one of these seven functions are considered optional, and are\r\nindicated with a star\r\nMichael Goodrich received his Ph.D. in Computer Science from Purdue University\r\nin 1987. He is currently a Chancellor’s Professor in the Department of Computer\r\nScience at University of California, Irvine. Previously, he was a professor at Johns\r\nHopkins University. He is a Fulbright Scholar and a Fellow of the American Association\r\nfor the Advancement of Science (AAAS), Association for Computing\r\nMachinery (ACM), and Institute of Electrical and Electronics Engineers (IEEE).\r\nHe is a recipient of the IEEE Computer Society Technical Achievement Award,\r\nthe ACM Recognition of Service Award, and the Pond Award for Excellence in\r\nUndergraduate Teaching.\r\nRoberto Tamassia received his Ph.D. in Electrical and Computer Engineering\r\nfrom the University of Illinois at Urbana–Champaign in 1988. He is the Plastech\r\nProfessor of Computer Science and the Chair of the Department of Computer Science\r\nat Brown University. He is also the Director of Brown’s Center for Geometric\r\nComputing. His research interests include information security, cryptography, analysis,\r\ndesign, and implementation of algorithms, graph drawing, and computational\r\ngeometry. He is a Fellow of the American Association for the Advancement of\r\nScience (AAAS), Association for Computing Machinery (ACM) and Institute for\r\nElectrical and Electronic Engineers (IEEE). He is a recipient of the IEEE Computer\r\nSociety Technical Achievement Award.\r\nMichael Goldwasser received his Ph.D. in Computer Science from Stanford\r\nUniversity in 1997. He is currently Professor and Director of the Computer Science\r\nprogram in the Department of Mathematics and Computer Science at Saint Louis\r\nUniversity. He was previously a faculty member in the Department of Computer\r\nScience at Loyola University Chicago. His research interests focus on the design\r\nand implementation of algorithms, having published work involving approximation\r\nalgorithms, online computation, computational biology, and computational geometry.\r\nHe is also active in the computer science education community\r\nOne of the primary uses of an object reference variable is to access the members of\r\nthe class for this object, an instance of its class. That is, an object reference variable\r\nis useful for accessing the methods and instance variables associated with an\r\nobject. This access is performed with the dot (“.”) operator. We call a method associated\r\nwith an object by using the reference variable name, following that by the dot\r\noperator and then the method name and its parameters. For example, in Code Fragment\r\n1.3, we call c.increment( ) at line 5, c.increment(3) at line 6, c.getCount( )\r\nat line 7, and c.reset( ) at line 8. If the dot operator is used on a reference that is\r\ncurrently null, the Java runtime environment will throw a NullPointerException.\r\nIf there are several methods with this same name defined for a class, then the\r\nJava runtime system uses the one that matches the actual number of parameters\r\nsent as arguments, as well as their respective types. For example, our Counter\r\nclass supports two methods named increment: a zero-parameter form and a oneparameter\r\nform. Java determines which version to call when evaluating commands\r\nsuch as c.increment( ) versus c.increment(3). A method’s name combined with the\r\nnumber and types of its parameters is called a method’s signature, for it takes all\r\nof these parts to determine the actual method to perform for a certain method call.\r\nNote, however, that the signature of a method in Java does not include the type that\r\nthe method returns, so Java does not allow two methods with the same signature to\r\nreturn different types.\r\nA reference variable v can be viewed as a “pointer” to some object o. It is as if\r\nthe variable is a holder for a remote control that can be used to control the newly\r\ncreated object (the device). That is, the variable has a way of pointing at the object\r\nand asking it to do things or give us access to its data. We illustrate this concept in\r\nFigure 1.2. Using the remote control analogy, a null reference is a remote control\r\nholder that is empty.', '2019-10-07 05:58:01', , 57);
INSERT INTO `bloggs` (`Bloger_id`, `bloge_title`, `bloge_content`, `bloge_date`, `image_bloge`, `user_id`) VALUES
(6, 'The linux command line', 'I want to tell you a story. No, not the story of how,\r\nin 1991, Linus Torvalds wrote the first version of the\r\nLinux kernel. You can read that story in lots of Linux\r\nbooks. Nor am I going to tell you the story of how,\r\nsome years earlier, Richard Stallman began the GNU Project to create a free\r\nUnix-like operating system. That’s an important story too, but most other\r\nLinux books have that one, as well. No, I want to tell you the story of how\r\nyou can take back control of your computer.\r\nWhen I began working with computers as a college student in the late\r\n1970s, there was a revolution going on. The invention of the microprocessor\r\nhad made it possible for ordinary people like you and me to actually own a\r\ncomputer. It’s hard for many people today to imagine what the world was\r\nlike when only big business and big government ran all the computers. Let’s\r\njust say you couldn’t get much done.\r\nToday, the world is very different. Computers are everywhere, from tiny\r\nwristwatches to giant data centers to everything in between. In addition to\r\nubiquitous computers, we also have a ubiquitous network connecting them\r\ntogether. This has created a wondrous new age of personal empowerment\r\nand creative freedom, but over the last couple of decades something else\r\nhas been happening. A single giant corporation has been imposing its control\r\nover most of the world’s computers and deciding what you can and cannot\r\ndo with them. Fortunately, people from all over the world are doing\r\nsomething about it. They are fighting to maintain control of their computers\r\nby writing their own software. They are building Linux.\r\nMany people speak of “freedom” with regard to Linux, but I don’t think\r\nmost people know what this freedom really means. Freedom is the power to\r\ndecide what your computer does, and the only way to have this freedom is to\r\nknow what your computer is doing. Freedom is a computer that is without\r\nsecrets, one where everything can be known if you care enough to find out.\r\nHave you ever noticed in the movies when the “super hacker”—you know,\r\nthe guy who can break into the ultra-secure military computer in under 30\r\nseconds—sits down at the computer, he never touches a mouse? It’s because\r\nmovie makers realize that we, as human beings, instinctively know the only\r\nway to really get anything done on a computer is by typing on a keyboard.\r\nMost computer users today are familiar with only the graphical user interface\r\n(GUI) and have been taught by vendors and pundits that the command line\r\ninterface (CLI) is a terrifying thing of the past. This is unfortunate, because a\r\ngood command line interface is a marvelously expressive way of communicating\r\nwith a computer in much the same way the written word is for human\r\nbeings. It’s been said that “graphical user interfaces make easy tasks easy, while\r\ncommand line interfaces make difficult tasks possible,” and this is still very\r\ntrue today.\r\nSince Linux is modeled after the Unix family of operating systems, it\r\nshares the same rich heritage of command line tools as Unix. Unix came into\r\nprominence during the early 1980s (although it was first developed a decade\r\nearlier), before the widespread adoption of the graphical user interface and,\r\nas a result, developed an extensive command line interface instead. In fact,\r\none of the strongest reasons early adopters of Linux chose it over, say, Windows\r\nNT was the powerful command line interface, which made the “difficult\r\ntasks possible.”\r\nThis book is a broad overview of “living” on the Linux command line.\r\nUnlike some books that concentrate on just a single program, such as the\r\nshell program, bash, this book will try to convey how to get along with the\r\ncommand line interface in a larger sense. How does it all work? What can it\r\ndo? What’s the best way to use it?\r\nThis is not a book about Linux system administration. While any serious\r\ndiscussion of the command line will invariably lead to system administration\r\ntopics, this book touches on only a few administration issues. It will, however,\r\nprepare the reader for additional study by providing a solid foundation\r\nin the use of the command line, an essential tool for any serious system\r\nadministration task.\r\nThis book is very Linux-centric. Many other books try to broaden their\r\nappeal by including other platforms, such as generic Unix and Mac OS X. In\r\ndoing so, they “water down” their content to feature only general topics. This\r\nbook, on the other hand, covers only contemporary Linux distributions. Ninetyfive\r\npercent of the content is useful for users of other Unix-like systems, but\r\nthis book is highly targeted at the modern Linux command line user.\r\n\r\nBe continued .....', '2019-10-07 06:12:54', , 56),
